import React from 'react';
import { NavLink } from 'react-router-dom';

export default class Homepage extends React.Component {
  render() {
    return (
      <div>
        <NavLink to="/game"><button>Play Game</button></NavLink>
        <button>Rules</button>
      </div>
    )
  }
}
